import {React} from 'react';

export function Logo({teamName}) {

    if(teamName==="Mumbai Indians"){
        const name = "MI";
    }

    return (
        <div className="Logo">
            <img src={require(`../${teamName}.png`).default} width="190" alt="team-logo" />
        </div>
        );
}
